package Operators;

public class Comparision {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int x=5,y=3;
		
		System.out.println(x==y);//equal to
		System.out.println(x!=y);//not equal to
		System.out.println(x>y);//greater than
		System.out.println(x<y);//lesserthan
		System.out.println(x>=y);//greaterthan equal to
		System.out.println(x<=y);//lesserthan equal to
	}

}
